import React, { useEffect, useState } from 'react';
import axios from 'axios';

const ComputerList = () => {
  const [computers, setComputers] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchComputers = async () => {
      try {
        const response = await axios.get('http://localhost:8090/api/v1/items/computers');
        console.log('Full fetched response:', response); // Log the full response
        console.log('Fetched data:', response.data); // Log the data to inspect it
        setComputers(response.data);
        setLoading(false);
      } catch (error) {
        console.error('Error fetching computers:', error);
        setError(error);
        setLoading(false);
      }
    };

    fetchComputers();
  }, []);

  if (loading) return <p>Loading...</p>;
  if (error) return <p>Error fetching data</p>;

  return (
    <div>
      <h2>Computers</h2>
      {computers.length === 0 ? (
        <p>No computers found.</p>
      ) : (
        computers.map((computer) => (
          <div key={computer.id} style={{ border: '1px solid black', margin: '10px', padding: '10px' }}>
            <p><strong>ID:</strong> {computer.id}</p>
            <p><strong>Brand:</strong> {computer.brand}</p>
            <p><strong>Years Used:</strong> {computer.yearsUsed}</p>
            <p><strong>Description:</strong> {computer.description}</p>
            <p><strong>Image URL:</strong> {computer.imageUrl}</p>
            {computer.signup && (
              <>
                <p><strong>Signup Name:</strong> {computer.signup.name}</p>
                <p><strong>Signup Email:</strong> {computer.signup.email}</p>
                <p><strong>Signup Phone No:</strong> {computer.signup.phone_no}</p>
                <p><strong>Signup Location:</strong> {computer.signup.location}</p>
              </>
            )}
          </div>
        ))
      )}
    </div>
  );
};

export default ComputerList;
